import React, { Component } from 'react';

import ResidentName from '../ResidentName';
import DateOfBirth from '../ResidentDOB';
import ResidentRoom from '../ResidentRoom';

class CarePlan extends Component {
  render() {
    return (
        <div className="container">
            <div>
                <h5>Resident Care Plan</h5>
                <div className="row">
                <div className="column" style={
                    {
                    border: '2px solid red',
                    width: "500px", minHeight: "200px"
                    }
                    }>
                <div className="row">
                    <div className="column">
                        <ResidentName />
                    </div>
                </div>
                <div className="row">
                    <div className="column">
                        <DateOfBirth/>
                    </div>
                    <div className="column">
                        <ResidentRoom/>
                    </div>

                </div>
                </div>

                <div className="column" style={
                    {
                    border: '2px solid red',
                    width: "500px", minHeight: "200px"
                    }
                    }>
                <div className="row">
                    <div className="column">
                        <ResidentName />
                    </div>
                </div>
                <div className="row">
                    <div className="column">
                        <DateOfBirth/>
                    </div>
                    <div className="column">
                        <ResidentRoom/>
                    </div>

                </div>
                </div>
            </div>
            </div>
        </div>

    );
  }
}

export default CarePlan;
